INSERT INTO transfertarea VALUES ('351', '4718', '6232', 1365605656, 1365605745, 'Observaciones : Asunto: Queja. Reclamante: Mara Esmeralda Zuleta. C.C 29136927. Paciente: Andrs Grajales. HC 2122028 . Cel: 3117255866 - 3127636938 . Funcionario: Dra. Juliana Bejarano  Cirujana Plstica. La usuaria manifiesta: Vengo desde Alcal Valle y no nos atendieron, debido a que la doctora est fuera de la ciudad y no fueron capaz de llamar a cancelarnos la cita, y esto nos acarrea gastos que dicha entidad no nos lo reconoce y para salir nos ponen problema, esto es jugar con el usuario, no nos respetan. Fecha de Consulta: Marzo 27 2013');
INSERT INTO transfertarea VALUES ('352', '4717', '1311', 1365600813, 1365605796, NULL);
INSERT INTO transfertarea VALUES ('353', '4717', '6232', 1365605780, 1365605796, 'Observaciones : Asunto: Queja. Paciente: Julio Csar Gmez Salazar C.C 16632298. HC 2168173. Cel: 3163456631 Tel: 4330991 . La usuaria manifiesta: El motivo de la queja por la inconformidad es: dieron citas para el 27 de marzo 2013, hice la observacin que era da de la semana santa, asisto a la cita y me encuentro que no solo yo pierdo mi cita, sino siete pacientes ms, incluidos nios y adultos y gente que viene de otros lugares. No tenemos ninguna explicacin clara al respecto, sabiendo nosotros que fue una falta de logstica. Consulta de Ciruga Plstica.');
INSERT INTO transfertarea VALUES ('354', '4716', '1311', 1365600527, 1365605854, NULL);
INSERT INTO transfertarea VALUES ('355', '4716', '6232', 1365605831, 1365605854, 'Observaciones : Asunto: Queja. Reclamante: Yamile Abonia Paz C.C 66.920.373. Paciente: Jhon Jaime Agredo Abona. HC 2191448 Cel: 3178634285 . Funcionario: Dra. Juliana Bejarano  Cirujana Plstica. La usuaria manifiesta: Me parece una falta de respeto grandsima que me cite para el da 27 de marzo 2013, gastando pasajes y tiempo en el trabajo, para que ahora me salgan con que no nos van a atender porque la Dra. Bejarano no saba que tena citas pendientes.');
INSERT INTO transfertarea VALUES ('356', '4712', '1311', 1365599513, 1365605903, NULL);
INSERT INTO transfertarea VALUES ('357', '4712', '6232', 1365605886, 1365605903, 'Observaciones : Asunto: Queja. Paciente: Sol Mara Rivas Angulo . c.c. 66.809.796 . Cel: 3127071447 Funcionario: Dra. Juliana Bejarano  Cirujana Plstica La usuaria manifiesta: Es para reportar la falta de responsabilidad por parte de la cirujana al dar citas a los usuarios sin tener el tiempo y haciendo que nosotros los usuarios perdamos gran parte de nuestro tiempo y nuestro dinero al venir a cumplir con una cita en la cual la cirujana no est presente, a parte de ser una irresponsabilidad, es falta de respeto a nosotros. Estas cosas son las que al no ver una respuesta pasaremos a Secretara de Salud. Espero respuesta. Fecha de la consulta: Marzo 27 2013.');
INSERT INTO transfertarea VALUES ('358', '4713', '1311', 1365599624, 1365605955, NULL);
INSERT INTO transfertarea VALUES ('359', '4713', '6232', 1365605940, 1365605955, 'Observaciones : Asunto: Queja. Reclamante: Patricia Carmona . c.c. 29.309.622. Paciente: Samuel Puerta Carmona C.C. 1112153624 HC 2202075 Cel: 3128889520  Tel: 2270582 Funcionario: Dra. Juliana Bejarano  Cirujana Plstica La usuaria manifiesta: El da 27 de marzo/2013, llegamos a las 2:00 pm a la cita que nos fue programada para la fecha ya mencionada, en ciruga plstica, nunca recibimos una llamada para decirnos que no iban a atender, habamos ocho pacientes de los cuales eran tres adultos y cinco nios. Considero que este error no debe quedar solo en una llamada de atencin por falta de compromiso y responsabilidad con los usuarios. Solicito que me hagan el favor y me devuelvan los viticos y mi da de trabajo, ya que el da que no trabaje no me lo pagan, adems en el momento en que llegamos a ciruga plstica haba una doctora que se encontraba ese da, con la cual habl el funcionario Jhoan del tercer piso ciruga quemados, esta funcionaria no nos dio la cara, falta de calidad h');
INSERT INTO transfertarea VALUES ('360', '4714', '1311', 1365600197, 1365605995, NULL);
INSERT INTO transfertarea VALUES ('361', '4714', '6232', 1365605973, 1365605995, 'Observaciones : Asunto: Queja. Reclamante: Jennifer Aparicio . C.C. 1114820940. Paciente: Mara de los ngeles Aparicio. HC 2201196 Cel: 3113514398 - 3147656086 Funcionario: Dra. Juliana Bejarano  Cirujana Plstica La usuaria manifiesta: El 27 de marzo la nia Mara de los ngeles tena cita con la Dra. Bejarano, la cual no fue atendida por ningn doctor, pues la verdad me parece falta de responsabilidad de la doctora, ya que no cumpli con la cita, pues no somos de all de Cali, somos de Rozo y carecemos de recursos para estar viajando, es ms la beb es hija de una paciente renal y no tenamos ni como venir. Espero que nos solucionen esta circunstancia, ya que hasta plata debemos aqu despus de la salida de la nia, el cual no nos dejaron cancelar con una pliza de la nia. Espero pronta respuesta y ojal todo lo que gastamos viviendo hasta ac, pues solo perd el tiempo. Gracias. ');
