INSERT INTO transfertarea VALUES ('5667', '56886', '9800', 1535737788, 1535739323, 'Es importante informar ala usuaria que dad las condiciones  de nios prematuros,algunos en el programa canguro el Hospital Universitario del Valle como Institucion Cerfificada IAMI ha realizado extensin de la permanencia de  las madres con el objetivo de garantizar el contacto piel a piel,la lactancia materna,el vinculo afectivo,en este sentido se debe entender la prrioridad dada  a los padres;sin alejarnos de la atencin humanizada se a concedido un espacio de tiempo a los abuelos el d viernes. La opcin de ampliacin de  horaarios de visitas se concede cuando los nios superan su proceso critico y en caso de necesitar continuar hospitalizados se pasen a las salas.');
INSERT INTO transfertarea VALUES ('5668', '56954', '8000', 1535658686, 1535751954, NULL);
INSERT INTO transfertarea VALUES ('5669', '56954', '2000', 1535750663, 1535751954, 'Se da respuesta a queja interpuesta por la Acudiente Amparo Guerrero, familiar del paciente GERMN PILL SOTO, paciente hospitalizado en Urgencias, La Sra.  Amparo hace 2 semanas me la encuentr en el 4 piso hospitalizacin "Muy alterada", "Muy enojada", le pregunto que le sucede: - estoy buscando al Doctor Gomez de Neurociruga que tiene unos CD de mi paciente que se encuentra en Urgencias. Le comunico que al Doctor Gomez debe buscarlo en oficina de Neurociruga de la Universidad del Valle o en Urgencias, sigue muy enojada y alterada, le digo que voy hacerle el favor de tratar de comunicarme con el Doctor Gomez. Lo logr ubicar y me refiere que el no tiene los CD.
INSERT INTO transfertarea VALUES ('5670', '56894', '9000', 1535044514, 1535752193, NULL);
INSERT INTO transfertarea VALUES ('5671', '56894', '9800', 1535750919, 1535752193, 'Es importante que lla usuaria conozca que el HUV es una institucin certificada como IAMI (institucin amiga de la  mujer y la infancia y que adherida a esta politica  ha extendido y gaarantizado el acompaamiento de los nios y con enfasis en los prematuros enel acompaamiento de la madre,el fortalecimiento de la lactancia materna y el contacto piel a piel de la madre. Comprendiendo el papel importante de los abuelos y hermanitos se abrio un espacio de visita para estos,pero en realidad la prioridad del tiempo mientras los nios permanezcan en  cirena es la madre,cuando los nios mejoren su estado y si continuan  cn su hospitalizacion en otro servicio pediatrico,el tiempo y los acompaantes no tendrn ninguna restriccion;estos procesos garantizan la prevencin de infecciones y complicaciones en los recien nacidos prematuros');
INSERT INTO transfertarea VALUES ('5672', '56898', '9000', 1535050680, 1535752386, NULL);
